import { View } from "@react-pdf/renderer"
import React from "react"
import Education from "./Education"
import createStyles from "../../styles/pdf/ColOne"
import Description from "../../components/pdf/Description"
import Technologies from "./Technologies"
import usePdfTheme from "../../hooks/usePdfTheme"
import ContactTop from "./Contact"
const ColOne = ({ data }) => {
  console.log("description:", description)

  console.log("data:", data)

  const { description, experience, contact, education, technologies, related } =
    data
  console.log("education:", education)

  const theme = usePdfTheme()
  const styles = createStyles(theme)

  return (
    <View style={styles.container}>
      {description ? <Description data={description} /> : null}
      <ContactTop data={contact} />
      {technologies ? <Technologies data={technologies} /> : null}
      {education ? <Education data={education} /> : null}
    </View>
  )
}

export default ColOne
